BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "category" (
	"id"	INTEGER NOT NULL,
	"name"	VARCHAR(32),
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "like" (
	"id"	INTEGER NOT NULL,
	"user_id"	INTEGER,
	"post_id"	INTEGER,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "follower" (
	"id"	INTEGER NOT NULL,
	"follower_id"	INTEGER,
	"following_id"	INTEGER,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "user" (
	"id"	INTEGER NOT NULL,
	"username"	VARCHAR(80),
	"email"	VARCHAR(80),
	"name"	VARCHAR(80),
	"lastname"	VARCHAR(80),
	"password"	VARCHAR(255),
	PRIMARY KEY("id"),
	UNIQUE("email"),
	UNIQUE("username")
);
CREATE TABLE IF NOT EXISTS "chat" (
	"id"	INTEGER NOT NULL,
	"id_user1"	INTEGER,
	"id_user2"	INTEGER,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "message" (
	"id"	INTEGER NOT NULL,
	"id_chat"	INTEGER,
	"id_sender"	INTEGER,
	"msg"	VARCHAR(1024),
	"date"	VARCHAR(30),
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "post" (
	"id"	INTEGER NOT NULL,
	"owner_id"	INTEGER,
	"category_id"	INTEGER,
	"title"	VARCHAR(80),
	"date"	VARCHAR(30),
	PRIMARY KEY("id"),
	FOREIGN KEY("category_id") REFERENCES "category"("id"),
	FOREIGN KEY("owner_id") REFERENCES "user"("id")
);
CREATE TABLE IF NOT EXISTS "comment" (
	"id"	INTEGER NOT NULL,
	"owner_id"	INTEGER,
	"post_id"	INTEGER,
	"text"	VARCHAR(260),
	"date"	VARCHAR(30),
	PRIMARY KEY("id"),
	FOREIGN KEY("post_id") REFERENCES "post"("id"),
	FOREIGN KEY("owner_id") REFERENCES "user"("id")
);
COMMIT;